package cn.test.demo.model;import java.util.HashMap;import java.util.Map;import cn.test.demo.base.mvp.BaseModel;import cn.test.demo.contract.WelcomeContract;import cn.test.demo.http.repository.HttpDataRepository;import cn.test.demo.http.retrofit.ApiConstants;import io.reactivex.Flowable;/** * Created by Sam on  2021-12-06  18:18 * Describe: */public class WelcomeModel extends BaseModel implements WelcomeContract.Model {    @Override    public Flowable<String> loadTestData(String cityId) {        Map<String, String> headers = new HashMap<>();        return HttpDataRepository.httpGet(ApiConstants.PROVINCE_LIST, headers, String.class);    }}